script: |
  super -f text -I q6783.spq | sort > q6783.out

inputs:
  - name: q6783.spq
    data: |
      SELECT 80 / + col0 * + col0 FROM tab1 (FORMAT parquet) WHERE + col1 - + - col2 - col1 * + 68 / col0 * col0 < 96 AND NOT - col1 / col2 + col2 BETWEEN - + col1 AND NULL;
  - name: tab1

outputs:
  - name: q6783.out
    data: |
